- uid: System.Web.Configuration.ProfileSettings.MaxLimit
  id: MaxLimit
  parent: System.Web.Configuration.ProfileSettings
  langs:
  - csharp
  name: MaxLimit
  nameWithType: ProfileSettings.MaxLimit
  fullName: System.Web.Configuration.ProfileSettings.MaxLimit
  type: Property
  assemblies:
  - System.Web
  namespace: System.Web.Configuration
  summary: "Hämtar eller anger det maximala antalet gånger som händelser av samma typ aktiveras."
  remarks: "Den här egenskapen måste ha ett värde som är större än noll. Värdet kan göras oändlig genom att ange <xref:System.Int32>.</xref:System.Int32> Ogiltiga värden kan orsaka ett undantagsfel när konfigurationsavsnittet sparas.       Den här egenskapen anger det maximala antalet gånger som en händelse av samma typ aktiveras. Om värdet är till exempel `10`, händelsen kommer att aktiveras 10 gånger och därefter ignoreras."
  example:
  - "The following code example shows how to use the MaxLimit property. This code example is part of a larger example provided for the <xref:System.Web.Configuration.HealthMonitoringSection> class.  \n  \n [!code-cs[System.Web.Configuration.HealthMonitoringSection#63](~/add/codesnippet/csharp/p-system.web.configurati_177_1.cs)]\n [!code-vb[System.Web.Configuration.HealthMonitoringSection#63](~/add/codesnippet/visualbasic/p-system.web.configurati_177_1.vb)]"
  syntax:
    content: public int MaxLimit { get; set; }
    return:
      type: System.Int32
      description: "Maximalt antal gånger som händelser av samma typ aktiveras. Standardvärdet är <xref:System.Int32>.</xref:System.Int32>"
  overload: System.Web.Configuration.ProfileSettings.MaxLimit*
  exceptions: []
  platform:
  - net462
- uid: System.Web.Configuration.ProfileSettings.MinInstances
  id: MinInstances
  parent: System.Web.Configuration.ProfileSettings
  langs:
  - csharp
  name: MinInstances
  nameWithType: ProfileSettings.MinInstances
  fullName: System.Web.Configuration.ProfileSettings.MinInstances
  type: Property
  assemblies:
  - System.Web
  namespace: System.Web.Configuration
  summary: "Hämtar eller anger det minsta antalet förekomster av händelsen innan händelsen utlöses för leverantören."
  remarks: "Den här egenskapen måste ha ett värde som är större än noll. Värdet kan göras oändlig genom att ange <xref:System.Int32>.</xref:System.Int32> Ogiltiga värden kan orsaka ett undantagsfel när konfigurationsavsnittet sparas.       Den här egenskapen anger det minsta antalet gånger som en händelse inträffar innan en händelse inträffar för leverantören. Till exempel värdet `5` innebär att ASP.NET inte utlösa en händelse till providern tills den femte förekomsten av händelsen inträffar. Om värdet är oändlig (<xref:System.Int32>), och sedan aktiveras ingen händelse till providern.</xref:System.Int32>"
  example:
  - "The following code example shows how to use the MinInstances property. This code example is part of a larger example provided for the <xref:System.Web.Configuration.HealthMonitoringSection> class.  \n  \n [!code-cs[System.Web.Configuration.HealthMonitoringSection#64](~/add/codesnippet/csharp/p-system.web.configurati_62_1.cs)]\n [!code-vb[System.Web.Configuration.HealthMonitoringSection#64](~/add/codesnippet/visualbasic/p-system.web.configurati_62_1.vb)]"
  syntax:
    content: public int MinInstances { get; set; }
    return:
      type: System.Int32
      description: "Minsta antal förekomster av händelsen innan händelsen utlöses för leverantören. Standardvärdet är <xref uid=&quot;langword_csharp_1&quot; name=&quot;1&quot; href=&quot;&quot;> </xref>."
  overload: System.Web.Configuration.ProfileSettings.MinInstances*
  exceptions: []
